window.bookSummaryJSON = "<p>Two people, alone in the universe, must fight against all odds to do what is right. </p> <p>Because Petty Officer Logan Miller saved Ambassador William's daughter, Kaylee, he was tasked with escorting her through the rough streets of Montlake. Little did he know a simple assignment would morph into a race across the galaxy. </p> <p>If he wants to get her to safety, Miller must avoid pirates, the Imperial Navy, and the hazards of deep space. All while keeping a decrepit starship from blowing up along the way. </p> <p>Kaylee Williams desperately needs to get to Taurus. The future of the Empire rests with the secret information she carries. But can she trust this strange man to help her? </p> <p>But if she can't trust a man who repeatedly risks his life for her, then who can she trust? </p>"; 
